import React, { useState, useEffect, useCallback } from 'react';
import './css/AdminDashboard.css';

const AdminDashboard = () => {
    const [dashboardData, setDashboardData] = useState(null);
    const [loading, setLoading] = useState(true);
    const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8000';

    const fetchData = useCallback(async () => {
        try {
            const response = await fetch(`${API_BASE_URL}/api/admin/dashboard/`);
            const data = await response.json();
            setDashboardData(data);
        } catch (error) {
            console.error("Failed to fetch admin data:", error);
        } finally {
            setLoading(false);
        }
    }, [API_BASE_URL]);

    useEffect(() => {
        fetchData();
        const interval = setInterval(fetchData, 30000);
        return () => clearInterval(interval);
    }, [fetchData]);

    if (loading) return <div className="admin-loader">Loading Admin Dashboard...</div>;
    if (!dashboardData) return <div>Failed to load data.</div>;

    const { station_data, registered_users, health_assessments } = dashboardData;

    return (
        <div className="main-wrapper">
            <aside className="sidebar">
                <div className="sidebar-header"><h1 className="sidebar-title">AQI Monitoring</h1></div>
                <ul className="nav flex-column">
                    <li className="nav-item"><a className="nav-link active" href="#"><i className="fas fa-tachometer-alt nav-icon"></i><span className="nav-text">Dashboard</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-users nav-icon"></i><span className="nav-text">Registered Users</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-heartbeat nav-icon"></i><span className="nav-text">Health Assessments</span></a></li>
                </ul>
            </aside>
            <main className="content-area">
                <div className="topbar">
                    <h1 className="topbar-title">Command Center</h1>
                    <div className="user-dropdown">
                        <div className="user-avatar"><i className="fas fa-user-shield"></i></div>
                        <span className="user-name">Admin</span>
                    </div>
                </div>
                <div className="station-grid">
                    {Object.entries(station_data).map(([id, station]) => (
                        <div className="dashboard-card" key={id}>
                            <div className="card-header">
                                <h5 className="card-title">{station.latest_item?.station_name || id}</h5>
                                <span className={`status-badge status-${station.status || 'ONLINE'}`}>{station.status || 'ONLINE'}</span>
                            </div>
                            <div className="card-body">
                                <p><strong>Current AQI:</strong> {Math.round(station.aqi || 0)}</p>
                                {/* Display other relevant metrics */}
                            </div>
                        </div>
                    ))}
                </div>
                <div className="data-card">
                    <div className="card-header"><h4 className="card-title">Registered Users ({registered_users.length})</h4></div>
                    <div className="card-body p-0">
                        <table className="data-table">
                            <thead><tr><th>ID</th><th>Name</th><th>Phone</th></tr></thead>
                            <tbody>
                                {registered_users.map(user => (
                                    <tr key={user.id}><td>{user.id}</td><td>{user.name}</td><td>{user.phone_number}</td></tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
                <div className="data-card">
                     <div className="card-header"><h4 className="card-title">Health Assessments ({health_assessments.length})</h4></div>
                     <div className="card-body p-0">
                        <table className="data-table">
                            <thead><tr><th>Username</th><th>Age Group</th><th>Score</th></tr></thead>
                            <tbody>
                                {health_assessments.map(h => (
                                    <tr key={h.id}>
                                        <td>{h.user__name}</td>
                                        <td>{h.age_group}</td>
                                        <td><span className={`health-score ${h.health_score > 70 ? 'health-score-high' : h.health_score > 40 ? 'health-score-medium' : 'health-score-low'}`}>{h.health_score}</span></td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </main>
        </div>
    );
};

export default AdminDashboard;
